import "./App.css";
import InputDisplay from "./components/input-display";
import Button from "./components/button";

function App() {
  const total = 0;
  return (
    <div className="flex justify-center">
      <div className="w-[34rem] h-[42rem] border-double border-2 border-zinc-900 rounded px-2 py-2 mb-2">
        <InputDisplay total={total}></InputDisplay>
        <section className="flex justify-between">
          <Button>C</Button>
          <Button>b</Button>
          <Button>c</Button>
          <Button>d</Button>
        </section>
      </div>
    </div>
  );
}

export default App;
